import React from 'react';
import PropTypes from 'prop-types';
import Head from 'next/head';

const TradeMarket = () => (
  <>
    <Head>
      <meta charSet="utf-8" />
      <title>거래자들</title>
    </Head>
  </>
);

Component.propTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default TradeMarket;
